public List MyPlanets() 
{
    List r = new ArrayList();
    for (Planet p : Planets) {
        if (p.ownedBy() == 1) {
            r.add(p);
        }
    }
    return r;
}

public List NeutralPlanets(){
	List r = new ArrayList();
	for (Planet p : planets) {
	    if (p.Owner() == 0) {
		r.add(p);
	    }
	}
	return r;
}

public List MyFleets(){
