public synchronized void shutdown() 
{
	if (this.locator != null)
	{
		this.locator.shutdown();
		this.locator = null;
	}
}

public synchronized void shutdown(){
		if (this.beanFactoryReference != null) {
			this.beanFactoryReference.release();
			this.beanFactoryReference = null;
		}
	}

